import React from "react";
import "./App.css";

const App = () => {
  return (
    <header className="header">
      <div className="logo">
        <img
          src="/logo.png" // Path relative to the `public` folder
          alt="DocDocket Logo"
        />
      </div>
    </header>
  );
};

export default App;
